import React from "react";
import "./HomePage.css";
import MusicPage from "../MusicPage";
import { Link } from "react-router-dom";

const HomePage = () => {

    return (
        <>
          {(
            <div className="button_wrapper">
              <Link to="/mymusic" className="gradient-border text"> BEGIN</Link>
            </div>
            
          )}
        </>
    )
}

export default HomePage
